import React, {useEffect, useState} from "react";
import DashboardMenuItem from "./DashboardMenuItem";
//import fetchDashboards from "../../../../Utilities/Data/Dashboards/DashboardData";
import axios from "axios";

export default function DashboardSideNav(props){
    const [dashboards,setDashboards] = useState(["Main"]);
    const menu = [];
    useEffect(()=>{

        async function fetchthedata(){

            let requestString = 'http://data.tickdash.io/dashboard';
            let myJson = await axios.get(requestString);
            return await myJson;
        }
        fetchthedata().then(result => {
            let dasher = [];
            for (const [index, value] of result.data.entries()) {
                dasher.push(value["title"]);
            }
            setDashboards(dasher);

        });

        }




    ,[]);

    for (const [index, value] of dashboards.entries()) {
        menu.push(<DashboardMenuItem name={value}/>)
    }
    return(
        <div>
            {menu}
        </div>
    )
}
